import React, { useState, useEffect } from "react";
import { Container, Row, Col, Form, Button } from "react-bootstrap";

import axios from "axios";

export default function App() {
  const [businessData, setBusinessData] = useState([]);
  const [currentPage, setCurrentPage] = useState(1);
  const [filters, setFilters] = useState({
    name: "",
    city: "",
    state: "",
    categories: "",
  });
  const pageSize = 25;

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await axios.get(
          `http://localhost:3001/api/data?page=${currentPage}&pageSize=${pageSize}&filterName=${filters.name}&filterCity=${filters.city}&filterState=${filters.state}&filterCategories=${filters.categories}`
        );
        setBusinessData(response.data);
      } catch (error) {
        console.error("Error fetching data:", error);
      }
    };

    fetchData();
  }, [currentPage, filters]);

  const handleFilterChange = (e) => {
    const { name, value } = e.target;
    setFilters((prevFilters) => ({ ...prevFilters, [name]: value }));
  };

  const handleResetFilters = () => {
    setFilters({ name: "", city: "", state: "", categories: "" });
  };

  return (
    <Container className="p-3">
      <Row className="mb-3">
        <Col md={3}>
          <Form.Control
            type="text"
            placeholder="Filter by Name"
            name="name"
            value={filters.name}
            onChange={handleFilterChange}
          />
        </Col>
        <Col md={3}>
          <Form.Control
            type="text"
            placeholder="Filter by City"
            name="city"
            value={filters.city}
            onChange={handleFilterChange}
          />
        </Col>
        <Col md={3}>
          <Form.Control
            type="text"
            placeholder="Filter by State"
            name="state"
            value={filters.state}
            onChange={handleFilterChange}
          />
        </Col>
        <Col md={3}>
          <Form.Control
            type="text"
            placeholder="Filter by Categories"
            name="categories"
            value={filters.categories}
            onChange={handleFilterChange}
          />
        </Col>
      </Row>

      <Row className="mb-3">
        <Col>
          <Button
            variant="primary"
            onClick={() =>
              setCurrentPage((prevPage) => Math.max(prevPage - 1, 1))
            }
            disabled={currentPage === 1}
          >
            Previous Page
          </Button>{" "}
          <span className="h5"> Page {currentPage} </span>{" "}
          <Button
            variant="primary"
            onClick={() => setCurrentPage((prevPage) => prevPage + 1)}
          >
            Next Page
          </Button>{" "}
          <Button variant="secondary" onClick={handleResetFilters}>
            Reset Filters
          </Button>
        </Col>
      </Row>

      <table className="table table-striped">
        <thead>
          <tr>
            <th scope="col">business_id</th>
            <th scope="col">name</th>
            <th scope="col">address</th>
            <th scope="col">city</th>
            <th scope="col">state</th>
            <th scope="col">postal_code</th>
            <th scope="col">stars</th>
            <th scope="col">review_count</th>
            <th scope="col">is_open</th>
            <th scope="col">categories</th>
          </tr>
        </thead>
        <tbody>
          {businessData.map((business) => (
            <tr key={business.business_id}>
              <td>{business.business_id}</td>
              <td>{business.name}</td>
              <td>{business.address}</td>
              <td>{business.city}</td>
              <td>{business.state}</td>
              <td>{business.postal_code}</td>
              <td>{business.stars}</td>
              <td>{business.review_count}</td>
              <td>{business.is_open}</td>
              <td>{business.categories}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </Container>
  );
}
